const Header = () => {


    const toggleClass = event => {

        event.currentTarget.classList.toggle('active');


    };
    return (
        <nav className="navbar">
            <div className="container">
                <div className="nav-elements">
                    <ul className='menu'>
                        <li>
                            <a href="/" onClick={toggleClass}>Accueil</a>
                        </li>
                        <li>
                            <a href="/Galerie" onClick={toggleClass}>Galerie</a>
                        </li>
                        <li>
                            <a href="/Tarifs_et_Prestations" onClick={toggleClass}>tarifs et prestations</a>
                        </li>
                        <li>
                            <a href="/Contact" onClick={toggleClass} >Contact</a>
                        </li>
                    </ul>
                </div>
            </div>
        </nav>
    )

}
export default Header
